import React from 'react';

const UploadForms = ()=>{
    const changeHandler = (e)=>{
        let selected = e.target.files[0].name;
        console.log(selected);
    }
    return (
        <form>
            <input type="file" onChange = {changeHandler}></input>
        </form>
    );
}
export default UploadForms;
